import React from 'react'
import styled from 'styled-components'
import Pokemon from './Pokemon'
import {BlueContainer, Colors} from './Styles'

const Base = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  background-color: gray;
  border: 1px solid black;
  border-radius: 5px;
  color: white;
  text-shadow: 1px 1px 1px black;
  width: 100%;
  height: 100%;
  font-family: "Pokemon", sans-serif;
  font-size: 15px;
  -webkit-font-smoothing: none;
`

const Card = styled.div`
  display: flex;
  width: 100%;
  height: 100%;
  padding: 12px;
  gap: 8px;
  align-items: center;
  justify-content: center;
`

const Player = styled.div`
  display: flex;
  flex-direction: column;
  gap: 4px;
`

const Character = styled(BlueContainer)`
  padding: 3px;
  aspect-ratio: 1/1;
  gap: 6px;
  align-items: center;
  justify-content: center;
  width: 112px;
  height: 112px;
  margin: 0;
`

const Name = styled(BlueContainer)`
  width: 100%;
  background: linear-gradient(to bottom, ${Colors.PRIMARY_DARK} 65%, ${Colors.PRIMARY_MEDIUM} 100%);
`

const Team = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr); /* Three columns */
  grid-auto-rows: min-content; /* Make row height only as tall as the content requires */
  gap: 4px;
`

const Trainer = ({game, name, gender, teamcount, team, boxes}) => {
  if (!game && !name) {
    return <Base/>
  }
  return (
    <Card $gender={gender}>
      <Player>
        <Character>
          {
            gender === 'boy'
              ? <Male
                game={game}
                size={96}
              />
              : <Female
                game={game}
                size={96}
              />
          }
          <Name>
            {name}
          </Name>
        </Character>
      </Player>
      <Team>
        {
          team?.length > 0 &&
          team.map(pkmn => {
            return (
              <Pokemon
                {...pkmn}
              />
            )
          })
        }
      </Team>
    </Card>
  )
}

export default Trainer

